import {Text} from 'react-native';
import GetRecipes from './GetRecipes';

const Home = async ({navigation, route}) => {
  const uid = route.params.uid;
  let recipeList = await GetRecipes(uid);
  //console.log(recipeList);
  return (
    <Text>Hello, {uid}</Text>
  );
};

export {Home};
